import React from 'react'
import Navbar from '../components/Navbar'

const Layout = ({children}) => {
  return (
   <React.Fragment>
    <div className='container mt-3'>
    <Navbar/>
    <main>{children}</main>
    </div>
   </React.Fragment>
  )
}

export default Layout
